import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
  state = {
    contacts: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      const properties = data;
      console.log(properties);
    })
    .catch(console.log)
  }
  render() {
    return (
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Address</th>
            <th>City</th>
            <th>State</th>
            <th>Zip Code</th>
            <th>County</th>
            <th>Phone</th>
            <th>Type</th>
            <th>Capacity</th>
          </tr>
        </thead>
        properties.map(item => (
           <tbody>
               <tr>
                 <td>1</td>
               </tr>
           </tbody>
        ))
      </Table>
    );
  }
}

export default App;
